import React from 'react';
import styled from 'styled-components';

const Ul = styled.ul<{open: boolean}>`
  z-index: 100;
  list-style: none;
  display: flex;
  flex-flow: row nowrap;
  overflow: scroll;
  overflow-x: hidden;
  li{
    margin-top: 1rem;
    padding: 0.5rem;
  }
  flex-flow: column nowrap;
  background-color: #e7a72f;
  position: fixed;
  opacity: ${({ open }) => open ? 1 : 0};
  top: 17vh;
  right: 4vw;
  height: 75vh;
  width: 17vw;
  border-radius: 1.1rem;
  transition: all 0.2s linear;
  font-family: 'Oxygen';
  font-size: 1.1rem;
  a{
  color: #0c1f3b;
  }
`;

interface RightNavBixoProps {
    open: boolean;
  }

const RightNavBixo = ({ open }: RightNavBixoProps) => {
  return (
    <Ul open={open}>
      <li><a href='#t1'>1.Bem Vindo!</a></li>
      <li><a href='#t2'>topico 2</a></li>
      <li><a href='#t3'>topico 3</a></li>
      <li><a href='#t4'>topico 4</a></li>
      <li><a href='#t5'>topico 5</a></li>
      <li><a href='#t6'>topico 6</a></li>
      <li><a href='#t7'>topico 7</a></li>
      <li><a href='#t8'>topico 8</a></li>
      <li><a href='#t9'>topico 9</a></li>
      <li><a href='#t10'>topico 10</a></li>
      <li><a href='#t11'>topico 11</a></li>
      <li><a href='#t12'>topico 12</a></li>
      <li><a href='#t13'>topico 13</a></li>
      <li><a href='#t14'>topico 14</a></li>
      <li><a href='#t15'>topico 15</a></li>
      <li><a href='#t16'>topico 16</a></li>
      <li><a href='#t17'>topico 17</a></li>
      <li><a href='#t18'>topico 18</a></li>
    </Ul>
  )
}

export default RightNavBixo;
